'use strict';

$(function () {
    $('.language_box')[0].onclick = function () {
        $('.language_box').toggleClass('language_box-off');
    };
    if (window.innerWidth >= 960) {
        var swiper = new Swiper('.swiper-container', {
            slidesPerView: 3,
            spaceBetween: 50,
            navigation: {
                nextEl: '.swiper-button-next',
                prevEl: '.swiper-button-prev'
            }
        });
    } else {
        var swiper = new Swiper('.swiper-container', {
            slidesPerView: 1,
            spaceBetween: 50,
            navigation: {
                nextEl: '.swiper-button-next',
                prevEl: '.swiper-button-prev'
            }
        });
    }

    //roadmap
    $('#detail-button').click(function () {
        $('.detail').toggleClass('detail-on');
        var isOn = $('.detail').hasClass('detail-on');
        console.log(isOn);
        if (isOn) {
            $('#detail-button').html('收起详情');
        } else {
            $('#detail-button').html('查看详情');
        }
    });

    //header fix

    $(window).scroll(function () {
        if ($(document).scrollTop() > 5) {
            $('.header-logo').attr('src', '/dist/resources/images/toplogo.svg');
            $('.navbar-wrapper').addClass('navbar-fix');
        } else {
            $('.header-logo').attr('src', '/dist/resources/images/bottomlogo.svg');
            $('.navbar-wrapper').removeClass('navbar-fix');
        }
    });

    //footer-links
    function relink() {
        if (location.href.indexOf('/jp/') !== -1) {
            location.href = '/jp/resource/';
        } else if (location.href.indexOf('/kr/') !== -1) {
            location.href = '/kr/resource/';
        } else {
            location.href = '/resource/';
        }
    }
    $('#whitePaper').click(function () {
        sessionStorage.setItem('resource-position', 'knowledge');
        sessionStorage.setItem('resource-index', 0);
        relink();
    });
    $('#guide').click(function () {
        sessionStorage.setItem('resource-position', 'knowledge');
        sessionStorage.setItem('resource-index', 1);
        relink();
    });
    $('#faq').click(function () {
        sessionStorage.setItem('resource-position', 'knowledge');
        sessionStorage.setItem('resource-index', 2);
        relink();
    });

    //二维码显示
    $('.qrcode').hover(function () {
        $(this).siblings('.qr-dropdown').css({ 'display': 'block' });
    }, function () {
        $(this).siblings('.qr-dropdown').css({ 'display': 'none' });
    });

    //lottie
    var animation = bodymovin.loadAnimation({
        container: document.getElementById('lottie'),
        renderer: 'svg',
        loop: true,
        autoplay: true,
        path: '/dist/resources/json/data.json'
    });
});

